recruitApp.controller('detailsOfCandidateCtrl', function($http, $routeParams, $window, CandidatesService) {
    
    $window.console = updateConsole($window.console);
    
    this.candidateID = $routeParams.candidateID;
    this.details = {};
    this.goBack = function() {
        $window.history.back();
    };
    
    CandidatesService.getCandidateDetails(this.candidateID)
                             .then(angular.bind(this, function(serverResponse) {
        this.details = serverResponse.data[0].details;
        this.nameOfCandidate = serverResponse.data[0].name;
        this.surnameOfCandidate = serverResponse.data[0].surname;
    }));
    
    this.saveDetails = function() {
        CandidatesService.saveCandidateDetails(this.details, this.candidateID)
                                 .then(angular.bind(this, function(serverResponse) {
            this.details = serverResponse.data[0].details;
        }));
    };
    
    this.addForm = function(section) {
        CandidatesService.addNewForm(section, this.details);
        this.saveDetails();
    };
    
    this.getSectionFields = function(detailSection, nbOfField) {
        if (nbOfField >= 2) {
            return detailSection['fields' + nbOfField];
        } else {
            return detailSection['fields'];
        }
    };
    
    this.downloadCV = angular.bind(this, function() {

        var recruitLogo = 'data:image/jpeg;base64,';
        var doc = new jsPDF();
        var htmlWrapper = document.createElement('div');
        
        var name = document.createElement('p');
        name.innerHTML = this.nameOfCandidate + " " + this.surnameOfCandidate;
        name.style.fontSize = 'xx-large';
        name.style.fontWeight = '500';
        name.style.width = '200px';
        name.style.margin = '0 0 0 450px';
        htmlWrapper.appendChild(name);
        
        var basicInfo = document.createElement('div');
        var basicInfoTitle = document.createElement('p');
        basicInfoTitle.innerHTML = '<br><br>Basic information';
        basicInfoTitle.style.fontSize = 'x-large';
        basicInfoTitle.style.fontWeight = '500';
        basicInfo.appendChild(basicInfoTitle);
        for (var i = 1, fieldsName; i < 10; i++) {
            i === 1 ? fieldsName = 'fields' : fieldsName = 'fields' + i;
            if (this.details.basicInfo[fieldsName]) {
                var basicInfoField = document.createElement('p');
                basicInfoField.innerHTML =  "Recommended on: " + this.details.basicInfo[fieldsName].recommendedOn.text + "<br>" +
                                            "Current position: " + this.details.basicInfo[fieldsName].currentPosition.text + "<br>" +
                                            "Availability: " + this.details.basicInfo[fieldsName].availability.text + "<br>" +
                                            "Salary expectations: " + this.details.basicInfo[fieldsName].salaryExpectations.text + "<br>" +
                                            "Languages: " + this.details.basicInfo[fieldsName].languages.text;
                basicInfoField.style.margin = "0";
                basicInfo.appendChild(basicInfoField);
            };
        };
        htmlWrapper.appendChild(basicInfo);
        
        var techSkills = document.createElement('p');
        techSkills.innerHTML = document.querySelector('#techSkills').value;
        
        var education = document.createElement('div');
        var educationTitle = document.createElement('p');
        educationTitle.innerHTML = '<br><br>Education';
        educationTitle.style.fontSize = 'x-large';
        educationTitle.style.fontWeight = '500';
        education.appendChild(educationTitle);
        for (var i = 1, fieldsName; i < 10; i++) {
            i === 1 ? fieldsName = 'fields' : fieldsName = 'fields' + i;
            if (this.details.education[fieldsName]) {
                var educationField = document.createElement('p');
                educationField.innerHTML =  "Date: " + this.details.education[fieldsName].startSchool.text + " - " +
                                            this.details.education[fieldsName].endSchool.text + "<br>" +
                                            "Name of school: " + this.details.education[fieldsName].nameOfSchool.text + "<br>" +
                                            "Faculty: " + this.details.education[fieldsName].faculty.text + "<br>" +
                                            "Specialization: " + this.details.education[fieldsName].specialization.text + "<br>" +
                                            "Degree: " + this.details.education[fieldsName].degree.text;
                educationField.style.margin = "0";
                education.appendChild(educationField);
            };
        };
        htmlWrapper.appendChild(education);
        
        var experience = document.createElement('div');
        var experienceTitle = document.createElement('p');
        experienceTitle.innerHTML = '<br><br>Experience';
        experienceTitle.style.fontSize = 'x-large';
        experienceTitle.style.fontWeight = '500';
        experience.appendChild(experienceTitle);
        for (var i = 1; i < 12; i++) {
            i === 1 ? fieldsName = 'fields' : fieldsName = 'fields' + i;
            if (this.details.experience[fieldsName]) {
                var experienceField = document.createElement('p');
                experienceField.innerHTML =  "Date: " + this.details.experience[fieldsName].startWork.text + " - " +
                                            this.details.experience[fieldsName].endWork.text + "<br>" +
                                            "Position: " + this.details.experience[fieldsName].position.text + "<br>" +
                                            "Company: " + this.details.experience[fieldsName].employer.text + "<br>" +
                                            "Responsibilities: " + this.details.experience[fieldsName].responsibilities.text + "<br>" +
                                            "Technologies: " + this.details.experience[fieldsName].technologies.text + "<br>" +
                                            "Reason of change: " + this.details.experience[fieldsName].reasonOfChange.text;
                experience.appendChild(experienceField);
            };
        };
        htmlWrapper.appendChild(experience);
        
       
        var courses = document.createElement('div');
        var coursesTitle = document.createElement('p');
        coursesTitle.innerHTML = '<br><br>Courses';
        coursesTitle.style.fontSize = 'x-large';
        coursesTitle.style.fontWeight = '500';
        courses.appendChild(coursesTitle);
        for (var i = 1; i < 10; i++) {
            i === 1 ? fieldsName = 'fields' : fieldsName = 'fields' + i;
            if (this.details.courses[fieldsName]) {
                var coursesField = document.createElement('p');
                coursesField.innerHTML =  "Date: " + this.details.courses[fieldsName].courseDate.text + "<br>" +
                                          "Name of course: " + this.details.courses[fieldsName].nameOfCourse.text + "<br>";
                courses.appendChild(coursesField);
            };
        };
        htmlWrapper.appendChild(courses);
        
        var additionalComment = document.createElement('div');
        var titleAdditionalComment = document.createElement('p');
        var additionalCommentContent = document.createElement('p');
        titleAdditionalComment.innerHTML = '<br><br>Additional comment';
        titleAdditionalComment.style.fontSize = 'x-large';
        titleAdditionalComment.style.fontWeight = '500';
        additionalComment.appendChild(titleAdditionalComment);
        additionalCommentContent.innerHTML = "<br>" + this.details.additionalComment.fields.additionalComment.text;
        additionalComment.appendChild(additionalCommentContent);
        htmlWrapper.appendChild(additionalComment);
        
        doc.addImage(recruitLogo, 'JPEG', 160, 5, 48, 12);
        doc.fromHTML(htmlWrapper, 20, 20, {'width': 170});

        var fileName = this.nameOfCandidate + " " + this.surnameOfCandidate + " CV.pdf";
        doc.save(fileName);
    });
    
});